-- ----------------------------
-- Table structure for device
-- ----------------------------
DROP TABLE IF EXISTS "operational"."device";
CREATE TABLE "operational"."device" (
  "id" varchar(50) COLLATE "pg_catalog"."default" NOT NULL,
  "name" varchar(50) COLLATE "pg_catalog"."default",
  "device_type" varchar(20) COLLATE "pg_catalog"."default",
  "env_type" varchar(10) COLLATE "pg_catalog"."default",
  "model" varchar(20) COLLATE "pg_catalog"."default",
  "vendor" varchar(10) COLLATE "pg_catalog"."default"
)
;
COMMENT ON COLUMN "operational"."device"."id" IS '设备唯一编号或序列号。';
COMMENT ON COLUMN "operational"."device"."name" IS '设备名称或呼号。';
COMMENT ON COLUMN "operational"."device"."device_type" IS '设备类型编码，例如 uav、robotic_dog、sensor 等。';
COMMENT ON COLUMN "operational"."device"."env_type" IS '部署环境或所属体系标识。';
COMMENT ON COLUMN "operational"."device"."model" IS '设备型号。';
COMMENT ON COLUMN "operational"."device"."vendor" IS '设备生产厂商简称。';
COMMENT ON TABLE "operational"."device" IS '设备基础信息表，存储可调度硬件的静态属性。';

