-- ----------------------------
-- Table structure for device_usage
-- ----------------------------
DROP TABLE IF EXISTS "operational"."device_usage";
CREATE TABLE "operational"."device_usage" (
  "id" uuid NOT NULL,
  "user_id" int8,
  "device_id" varchar(50) COLLATE "pg_catalog"."default",
  "car_id" int8
)
;
COMMENT ON COLUMN "operational"."device_usage"."user_id" IS '用户id';
COMMENT ON COLUMN "operational"."device_usage"."device_id" IS '占用设备id';
COMMENT ON COLUMN "operational"."device_usage"."car_id" IS '车id';

-- ----------------------------
-- Records of device_usage
-- ----------------------------

-- ----------------------------
-- Table structure for entities
-- ----------------------------
DROP TABLE IF EXISTS "operational"."entities";
CREATE TABLE "operational"."entities" (
  "id" uuid NOT NULL DEFAULT uuid_generate_v4(),
  "type" text COLLATE "pg_catalog"."default" NOT NULL,
  "geometry" geography(GEOMETRY),
  "properties" jsonb NOT NULL DEFAULT '{}'::jsonb,
  "created_by" varchar(100) COLLATE "pg_catalog"."default",
  "updated_by" varchar(100) COLLATE "pg_catalog"."default",
  "created_at" timestamptz(6) NOT NULL DEFAULT now(),
  "updated_at" timestamptz(6) NOT NULL DEFAULT now(),
  "deleted_at" timestamptz(6),
  "layer_code" varchar(100) COLLATE "pg_catalog"."default" NOT NULL,
  "image" text COLLATE "pg_catalog"."default",
  "source" "operational"."entity_source_enum" NOT NULL DEFAULT 'system'::operational.entity_source_enum,
  "is_visible_on_map" bool NOT NULL DEFAULT true,
  "is_dynamic" bool NOT NULL DEFAULT false,
  "last_position_at" timestamptz(6),
  "style_overrides" jsonb NOT NULL DEFAULT '{}'::jsonb
)
;
COMMENT ON COLUMN "operational"."entities"."id" IS '实体主键，UUID。';
COMMENT ON COLUMN "operational"."entities"."type" IS '实体类型枚举，决定前端展示与业务处理逻辑。';
COMMENT ON COLUMN "operational"."entities"."geometry" IS '实体空间位置或范围（PostGIS GEOGRAPHY）。';
COMMENT ON COLUMN "operational"."entities"."properties" IS '实体属性JSON，记录动态状态、图层配置等。';
COMMENT ON COLUMN "operational"."entities"."created_by" IS '创建该实体的用户或Agent。';
COMMENT ON COLUMN "operational"."entities"."updated_by" IS '最近一次更新实体的用户或Agent。';
COMMENT ON COLUMN "operational"."entities"."created_at" IS '实体创建时间。';
COMMENT ON COLUMN "operational"."entities"."updated_at" IS '实体最近更新时间。';
COMMENT ON COLUMN "operational"."entities"."deleted_at" IS '软删除时间，NULL表示仍然有效。';
COMMENT ON COLUMN "operational"."entities"."layer_code" IS '实体所属图层编码';
COMMENT ON COLUMN "operational"."entities"."image" IS '图标';
COMMENT ON COLUMN "operational"."entities"."source" IS '实体来源：system=自动采集，manual=人工标绘';
COMMENT ON COLUMN "operational"."entities"."is_visible_on_map" IS '是否在前端地图展示实体';
COMMENT ON COLUMN "operational"."entities"."is_dynamic" IS '是否为动态实体，决定推送频率';
COMMENT ON COLUMN "operational"."entities"."last_position_at" IS '动态实体最新定位时间';
COMMENT ON COLUMN "operational"."entities"."style_overrides" IS '实体级别样式覆盖配置(JSON)';
COMMENT ON TABLE "operational"."entities" IS '作战实体表，抽象统一的人员、装备、标注等动态对象。';

-- ----------------------------
