DROP TABLE IF EXISTS "operational"."entity_detail";
CREATE TABLE "operational"."entity_detail" (
  "entity_id" uuid NOT NULL,
  "detail" jsonb
)
;
COMMENT ON COLUMN "operational"."entity_detail"."entity_id" IS '关联的实体ID，引用 operational.entities.id。';
COMMENT ON COLUMN "operational"."entity_detail"."detail" IS '实体详情JSON，例如设备参数、人员履历等。';
COMMENT ON TABLE "operational"."entity_detail" IS '实体详情表，补充实体的结构化档案信息。';

