-- Table structure for entity_relation
-- ----------------------------
DROP TABLE IF EXISTS "operational"."entity_relation";
CREATE TABLE "operational"."entity_relation" (
  "entity_id" uuid NOT NULL,
  "relation_entity_ids" varchar(255) COLLATE "pg_catalog"."default"
)
;
COMMENT ON COLUMN "operational"."entity_relation"."entity_id" IS '主实体ID，引用 operational.entities.id。';
COMMENT ON COLUMN "operational"."entity_relation"."relation_entity_ids" IS '与主实体关联的其他实体ID集合，存储格式由业务服务解析。';
COMMENT ON TABLE "operational"."entity_relation" IS '实体关系表，维护实体之间的连接（编组、支援链路等）。';

