  "event_code" varchar(64) COLLATE "pg_catalog"."default",
  "title" varchar(255) COLLATE "pg_catalog"."default" NOT NULL,
  "alert_level" int2 NOT NULL,
  "is_primary" bool NOT NULL DEFAULT true,
  "hazard_type" "operational"."hazard_type_enum" NOT NULL,
