  "origin" varchar(100) COLLATE "pg_catalog"."default",
  "content" text COLLATE "pg_catalog"."default",
  "report" text COLLATE "pg_catalog"."default",
  "status" int2 NOT NULL DEFAULT 1,
  "created_at" timestamptz(6) NOT NULL DEFAULT now(),
  "updated_at" timestamptz(6) NOT NULL DEFAULT now(),
  "deleted_at" timestamptz(6)
)
;
COMMENT ON COLUMN "operational"."event_alerts"."id" IS '告警记录主键，自增ID。';
COMMENT ON COLUMN "operational"."event_alerts"."event_id" IS '关联的事件ID，引用 operational.events.id。';
COMMENT ON COLUMN "operational"."event_alerts"."event_code" IS '外部事件编号或上报编号。';
COMMENT ON COLUMN "operational"."event_alerts"."title" IS '告警标题。';
COMMENT ON COLUMN "operational"."event_alerts"."alert_level" IS '告警等级：1特别重大、2重大、3较大、4一般。';
COMMENT ON COLUMN "operational"."event_alerts"."is_primary" IS '是否主灾害事件，true 表示主事件，false 表示附属事件。';
COMMENT ON COLUMN "operational"."event_alerts"."hazard_type" IS '灾害类型枚举，对应前端的风险分类。';
COMMENT ON COLUMN "operational"."event_alerts"."occurred_at" IS '告警触发时间。';
COMMENT ON COLUMN "operational"."event_alerts"."origin" IS '信息来源渠道（如地震台网、气象局等）。';
COMMENT ON COLUMN "operational"."event_alerts"."content" IS '告警正文或摘要。';
COMMENT ON COLUMN "operational"."event_alerts"."report" IS '原始上报详情或补充说明。';
COMMENT ON COLUMN "operational"."event_alerts"."status" IS '记录状态码，1=有效，2=已解除等。';
COMMENT ON COLUMN "operational"."event_alerts"."created_at" IS '告警记录创建时间。';
COMMENT ON COLUMN "operational"."event_alerts"."updated_at" IS '告警记录最近更新时间。';
COMMENT ON COLUMN "operational"."event_alerts"."deleted_at" IS '软删除时间，NULL表示记录有效。';
COMMENT ON TABLE "operational"."event_alerts" IS '告警记录表，留存来自各渠道的事件告警信息。';

