DROP TABLE IF EXISTS "operational"."events";
CREATE TABLE "operational"."events" (
  "id" uuid NOT NULL DEFAULT uuid_generate_v4(),
  "parent_event_id" uuid,
  "event_code" varchar(64) COLLATE "pg_catalog"."default",
  "title" varchar(255) COLLATE "pg_catalog"."default" NOT NULL,
  "type" "operational"."event_type_enum" NOT NULL,
  "priority" int2 NOT NULL DEFAULT 50,
  "description" text COLLATE "pg_catalog"."default",
  "created_by" varchar(100) COLLATE "pg_catalog"."default",
  "updated_by" varchar(100) COLLATE "pg_catalog"."default",
  "created_at" timestamptz(6) NOT NULL DEFAULT now(),
  "updated_at" timestamptz(6) NOT NULL DEFAULT now(),
  "deleted_at" timestamptz(6),
  "status" "operational"."event_status_enum" NOT NULL DEFAULT 'pending'::operational.event_status_enum
)
;
COMMENT ON COLUMN "operational"."events"."id" IS '事件主键，UUID。';
COMMENT ON COLUMN "operational"."events"."parent_event_id" IS '父事件ID，用于表达次生灾害或事件树结构。';
COMMENT ON COLUMN "operational"."events"."event_code" IS '事件编码，通常来自外部预警系统。';
COMMENT ON COLUMN "operational"."events"."title" IS '事件标题或名称。';
COMMENT ON COLUMN "operational"."events"."type" IS '事件类型：infrastructure_failure=基础设施受损，people_trapped=人员被困，secondary_hazard=次生灾害，resource_request=资源请求，external_info=外部情报，transit_update=行进动态，communication=通信联络，sensor_data=传感器数据，uav_intelligence=无人机情报，road_condition=道路状况，position_report=位置上报。';
COMMENT ON COLUMN "operational"."events"."priority" IS '事件处理优先级，范围0-100，数值越高越紧急。';
COMMENT ON COLUMN "operational"."events"."description" IS '事件详细描述。';
COMMENT ON COLUMN "operational"."events"."created_by" IS '创建事件的用户或系统。';
COMMENT ON COLUMN "operational"."events"."updated_by" IS '最近更新事件的用户或系统。';
COMMENT ON COLUMN "operational"."events"."created_at" IS '事件创建时间。';
COMMENT ON COLUMN "operational"."events"."updated_at" IS '事件最近更新时间。';
COMMENT ON COLUMN "operational"."events"."deleted_at" IS '软删除时间。';
COMMENT ON COLUMN "operational"."events"."status" IS '事件状态：pending=待确认，active=处理中，resolved=已处置，cancelled=已取消。';
COMMENT ON TABLE "operational"."events" IS '事件主表，记录应急场景中的事件及其状态。';

