DROP TABLE IF EXISTS "operational"."mission_entities";
CREATE TABLE "operational"."mission_entities" (
  "mission_id" uuid NOT NULL,
  "entity_id" uuid NOT NULL,
  "relation_type" varchar(50) COLLATE "pg_catalog"."default" NOT NULL,
  "description" text COLLATE "pg_catalog"."default",
  "created_at" timestamptz(6) NOT NULL DEFAULT now()
)
;
COMMENT ON COLUMN "operational"."mission_entities"."mission_id" IS '任务ID，引用 operational.missions.id。';
COMMENT ON COLUMN "operational"."mission_entities"."entity_id" IS '实体ID，引用 operational.entities.id。';
COMMENT ON COLUMN "operational"."mission_entities"."relation_type" IS '在任务中的关系角色，例如 target、support、route。';
COMMENT ON COLUMN "operational"."mission_entities"."description" IS '关联说明或任务内备注。';
COMMENT ON COLUMN "operational"."mission_entities"."created_at" IS '建立关联的时间。';
COMMENT ON TABLE "operational"."mission_entities" IS '任务-实体关联表，标记任务涉及的资源或目标。';

-- ----------------------------
-- Records of mission_entities
-- ----------------------------

-- ----------------------------
-- Table structure for mission_log
-- ----------------------------
DROP TABLE IF EXISTS "operational"."mission_log";
CREATE TABLE "operational"."mission_log" (
  "id" int8 NOT NULL,
  "user_id" int8,
  "description" varchar(255) COLLATE "pg_catalog"."default",
  "timestamp" timestamptz(6),
  "mission_id" varchar(50) COLLATE "pg_catalog"."default"
)
;
COMMENT ON COLUMN "operational"."mission_log"."description" IS '任务描述';
COMMENT ON COLUMN "operational"."mission_log"."timestamp" IS '记录时间戳';
COMMENT ON COLUMN "operational"."mission_log"."mission_id" IS '任务id';
COMMENT ON TABLE "operational"."mission_log" IS '任务日志';

-- ----------------------------
-- Records of mission_log
-- ----------------------------

-- ----------------------------
-- Table structure for mission_plans
-- ----------------------------
DROP TABLE IF EXISTS "operational"."mission_plans";
CREATE TABLE "operational"."mission_plans" (
  "mission_id" uuid NOT NULL,
  "plan_data" jsonb NOT NULL DEFAULT '{"equipment": {"own": [], "friendly": []}, "personnel": [], "objectives": []}'::jsonb,
  "generated_by" varchar(50) COLLATE "pg_catalog"."default" NOT NULL,
  "generated_at" timestamptz(6) NOT NULL DEFAULT now(),
  "confirmed_by" varchar(100) COLLATE "pg_catalog"."default",
  "confirmed_at" timestamptz(6),
  "dispatched_at" timestamptz(6),
  "created_at" timestamptz(6) NOT NULL DEFAULT now(),
  "updated_at" timestamptz(6) NOT NULL DEFAULT now()
)
;
COMMENT ON COLUMN "operational"."mission_plans"."mission_id" IS '任务ID，引用 operational.missions.id，亦作为主键。';
COMMENT ON COLUMN "operational"."mission_plans"."plan_data" IS '方案主体JSON，包含目标、人员、装备、友军支援等结构化内容。';
COMMENT ON COLUMN "operational"."mission_plans"."generated_by" IS '方案生成方式：ai=AI生成，manual=人工录入。';
COMMENT ON COLUMN "operational"."mission_plans"."generated_at" IS '方案生成时间。';
COMMENT ON COLUMN "operational"."mission_plans"."confirmed_by" IS '确认方案的指挥员或角色。';
COMMENT ON COLUMN "operational"."mission_plans"."confirmed_at" IS '方案确认时间。';
COMMENT ON COLUMN "operational"."mission_plans"."dispatched_at" IS '方案下发时间，下发后席位进入准备流程。';
COMMENT ON COLUMN "operational"."mission_plans"."created_at" IS '记录创建时间。';
COMMENT ON COLUMN "operational"."mission_plans"."updated_at" IS '记录最近更新时间。';
COMMENT ON TABLE "operational"."mission_plans" IS '任务准备方案表，存储AI生成或人工创建的行动计划。';

-- ----------------------------
-- Records of mission_plans
-- ----------------------------

-- ----------------------------
-- Table structure for missions
-- ----------------------------
DROP TABLE IF EXISTS "operational"."missions";
CREATE TABLE "operational"."missions" (
  "id" uuid NOT NULL DEFAULT uuid_generate_v4(),
  "parent_mission_id" uuid,
  "source_event_id" uuid,
  "title" varchar(255) COLLATE "pg_catalog"."default" NOT NULL,
  "phase" "operational"."mission_phase" NOT NULL DEFAULT 'preparation'::operational.mission_phase,
  "status" "operational"."mission_status_enum" NOT NULL DEFAULT 'active'::operational.mission_status_enum,
  "location" geography(POINT, 4326),
  "event_details" jsonb DEFAULT '{}'::jsonb,
  "created_by" varchar(100) COLLATE "pg_catalog"."default",
  "updated_by" varchar(100) COLLATE "pg_catalog"."default",
  "created_at" timestamptz(6) NOT NULL DEFAULT now(),
  "updated_at" timestamptz(6) NOT NULL DEFAULT now(),
  "deleted_at" timestamptz(6),
  "confirmed_by" varchar(100) COLLATE "pg_catalog"."default",
  "confirmed_at" timestamptz(6),
  "preparation_started_at" timestamptz(6),
  "departed_at" timestamptz(6),
  "vehicle_id" varchar(100) COLLATE "pg_catalog"."default",
  "transit_started_at" timestamptz(6),
  "arrived_at" timestamptz(6),
  "current_route_id" uuid,
  "transit_metadata" jsonb DEFAULT '{}'::jsonb,
  "equipment_selected" jsonb,
  "supply_selected" jsonb
)
;
COMMENT ON COLUMN "operational"."missions"."id" IS '任务主键，UUID。';
COMMENT ON COLUMN "operational"."missions"."parent_mission_id" IS '父任务ID，用于拆分子任务或联合任务场景。';
COMMENT ON COLUMN "operational"."missions"."source_event_id" IS '触发任务的事件ID，引用 operational.events.id。';
COMMENT ON COLUMN "operational"."missions"."title" IS '任务名称。';
COMMENT ON COLUMN "operational"."missions"."phase" IS '任务阶段：preparation=筹备，transit=行进，recon=侦察，rescue=救援，evaluation=评估。';
COMMENT ON COLUMN "operational"."missions"."status" IS '任务运行状态：active=激活中，paused=已暂停，completed=已完成，cancelled=已取消，archived=已归档。';
COMMENT ON COLUMN "operational"."missions"."location" IS '任务参考坐标（PostGIS GEOGRAPHY Point），通常为指挥所位置。';
COMMENT ON COLUMN "operational"."missions"."event_details" IS '触发事件摘要JSON，保存事件关键情报。';
COMMENT ON COLUMN "operational"."missions"."created_by" IS '任务创建者。';
COMMENT ON COLUMN "operational"."missions"."updated_by" IS '任务最近更新者。';
COMMENT ON COLUMN "operational"."missions"."created_at" IS '任务创建时间。';
COMMENT ON COLUMN "operational"."missions"."updated_at" IS '任务最近更新时间。';
COMMENT ON COLUMN "operational"."missions"."deleted_at" IS '软删除时间。';
COMMENT ON COLUMN "operational"."missions"."confirmed_by" IS '任务确认或授权人。';
COMMENT ON COLUMN "operational"."missions"."confirmed_at" IS '任务确认时间。';
COMMENT ON COLUMN "operational"."missions"."preparation_started_at" IS '准备阶段开始时间。';
COMMENT ON COLUMN "operational"."missions"."departed_at" IS '救援力量出发时间。';
COMMENT ON COLUMN "operational"."missions"."vehicle_id" IS '任务主用车辆或运输工具编号。';
COMMENT ON COLUMN "operational"."missions"."transit_started_at" IS '转运开始时间';
COMMENT ON COLUMN "operational"."missions"."arrived_at" IS '到达现场时间';
COMMENT ON COLUMN "operational"."missions"."current_route_id" IS '当前活跃路线ID';
COMMENT ON COLUMN "operational"."missions"."transit_metadata" IS '转运阶段元数据(JSONB)';
COMMENT ON COLUMN "operational"."missions"."equipment_selected" IS '所选装备json数组（之后可改成id列表）';
COMMENT ON COLUMN "operational"."missions"."supply_selected" IS '所选物资json数组';
COMMENT ON TABLE "operational"."missions" IS '任务主表，统筹应急救援的全生命周期。';

-- ----------------------------
-- Records of missions
-- ----------------------------

