-- Table structure for navigation_routes
-- ----------------------------
DROP TABLE IF EXISTS "operational"."navigation_routes";
CREATE TABLE "operational"."navigation_routes" (
  "id" uuid NOT NULL DEFAULT uuid_generate_v4(),
  "mission_id" uuid NOT NULL,
  "version" int4 NOT NULL DEFAULT 1,
  "route_type" varchar(50) COLLATE "pg_catalog"."default" NOT NULL,
  "start_point" geography(POINT, 4326) NOT NULL,
  "end_point" geography(POINT, 4326) NOT NULL,
  "waypoints" jsonb NOT NULL DEFAULT '[]'::jsonb,
  "distance_meters" float8,
  "estimated_duration_seconds" int4,
  "is_active" bool NOT NULL DEFAULT false,
  "adjustment_reason" text COLLATE "pg_catalog"."default",
  "created_by" varchar(100) COLLATE "pg_catalog"."default",
  "created_at" timestamptz(6) NOT NULL DEFAULT now(),
  "activated_at" timestamptz(6),
  "deactivated_at" timestamptz(6),
  "path" geography(LINESTRING, 4326)
)
;
COMMENT ON COLUMN "operational"."navigation_routes"."id" IS '路线主键，UUID。';
COMMENT ON COLUMN "operational"."navigation_routes"."mission_id" IS '关联任务ID，引用 operational.missions.id。';
COMMENT ON COLUMN "operational"."navigation_routes"."version" IS '路线版本号，从1开始递增。';
COMMENT ON COLUMN "operational"."navigation_routes"."route_type" IS '路线类型：planned=计划路线，adjusted=调整后的路线，emergency=紧急改道。';
COMMENT ON COLUMN "operational"."navigation_routes"."start_point" IS '路线起点坐标（GEOGRAPHY Point）。';
COMMENT ON COLUMN "operational"."navigation_routes"."end_point" IS '路线终点坐标（GEOGRAPHY Point）。';
COMMENT ON COLUMN "operational"."navigation_routes"."waypoints" IS '路径点JSON数组，记录沿途关键节点。';
COMMENT ON COLUMN "operational"."navigation_routes"."distance_meters" IS '路线总距离，单位米。';
COMMENT ON COLUMN "operational"."navigation_routes"."estimated_duration_seconds" IS '预计耗时，单位秒。';
COMMENT ON COLUMN "operational"."navigation_routes"."is_active" IS '是否为当前激活路线，同一任务仅允许一个true。';
COMMENT ON COLUMN "operational"."navigation_routes"."adjustment_reason" IS '路线调整或启用的原因说明。';
COMMENT ON COLUMN "operational"."navigation_routes"."created_by" IS '路线创建者。';
COMMENT ON COLUMN "operational"."navigation_routes"."created_at" IS '路线创建时间。';
COMMENT ON COLUMN "operational"."navigation_routes"."activated_at" IS '路线被激活的时间。';
COMMENT ON COLUMN "operational"."navigation_routes"."deactivated_at" IS '路线停用的时间。';
COMMENT ON COLUMN "operational"."navigation_routes"."path" IS 'Route path as LINESTRING geometry (EPSG:4326 WGS84). Converted from waypoints JSONB for native GIS rendering. waypoints column retained for backward compatibility.';
COMMENT ON TABLE "operational"."navigation_routes" IS '任务行进路线表，管理路线版本与激活状态。';

-- ----------------------------
-- Records of navigation_routes
-- ----------------------------

-- ----------------------------
-- Table structure for poi_points
-- ----------------------------
DROP TABLE IF EXISTS "operational"."poi_points";
CREATE TABLE "operational"."poi_points" (
  "poi_id" uuid NOT NULL DEFAULT uuid_generate_v4(),
  "name" varchar(255) COLLATE "pg_catalog"."default" NOT NULL,
  "poi_type" varchar(100) COLLATE "pg_catalog"."default" NOT NULL,
  "location" geography(POINT, 4326) NOT NULL,
  "area_sqm" float8,
  "terrain_type" varchar(50) COLLATE "pg_catalog"."default",
  "slope" float8,
  "elevation" float8,
  "infrastructure" jsonb DEFAULT '{}'::jsonb,
  "properties" jsonb DEFAULT '{}'::jsonb,
  "created_by" varchar(100) COLLATE "pg_catalog"."default",
  "updated_by" varchar(100) COLLATE "pg_catalog"."default",
  "created_at" timestamptz(6) NOT NULL DEFAULT now(),
  "updated_at" timestamptz(6) NOT NULL DEFAULT now(),
  "deleted_at" timestamptz(6)
)
;
COMMENT ON COLUMN "operational"."poi_points"."poi_id" IS 'POI主键，UUID。';
COMMENT ON COLUMN "operational"."poi_points"."name" IS '兴趣点名称。';
COMMENT ON COLUMN "operational"."poi_points"."poi_type" IS '兴趣点类型，如 hospital、fire_station、shelter 等。';
COMMENT ON COLUMN "operational"."poi_points"."location" IS '兴趣点坐标（GEOGRAPHY Point）。';
COMMENT ON COLUMN "operational"."poi_points"."area_sqm" IS '占地面积，单位平方米。';
COMMENT ON COLUMN "operational"."poi_points"."terrain_type" IS '地形类型，例如 plain、hill、mountain。';
COMMENT ON COLUMN "operational"."poi_points"."slope" IS '坡度（度），范围0-90。';
COMMENT ON COLUMN "operational"."poi_points"."elevation" IS '海拔高度，单位米。';
COMMENT ON COLUMN "operational"."poi_points"."infrastructure" IS '基础设施能力JSON，如供水、供电、通信等。';
COMMENT ON COLUMN "operational"."poi_points"."properties" IS '扩展属性JSON，用于业务自定义字段。';
COMMENT ON COLUMN "operational"."poi_points"."created_by" IS '记录创建者。';
COMMENT ON COLUMN "operational"."poi_points"."updated_by" IS '记录最近更新者。';
COMMENT ON COLUMN "operational"."poi_points"."created_at" IS '记录创建时间。';
COMMENT ON COLUMN "operational"."poi_points"."updated_at" IS '记录最近更新时间。';
COMMENT ON COLUMN "operational"."poi_points"."deleted_at" IS '软删除时间。';
COMMENT ON TABLE "operational"."poi_points" IS '兴趣点（POI）表，保存救援相关的静态基础设施位置。';

