-- ----------------------------
-- Table structure for rescuers
-- ----------------------------
DROP TABLE IF EXISTS "operational"."rescuers";
CREATE TABLE "operational"."rescuers" (
  "rescuer_id" uuid NOT NULL DEFAULT gen_random_uuid(),
  "name" varchar(200) COLLATE "pg_catalog"."default" NOT NULL,
  "rescuer_type" varchar(50) COLLATE "pg_catalog"."default" NOT NULL,
  "team_id" uuid,
  "team_name" varchar(200) COLLATE "pg_catalog"."default",
  "current_location" geography(POINT, 4326),
  "status" varchar(50) COLLATE "pg_catalog"."default" DEFAULT 'available'::character varying,
  "availability" bool DEFAULT true,
  "skills" text[] COLLATE "pg_catalog"."default",
  "equipment" jsonb DEFAULT '{}'::jsonb,
  "phone" varchar(50) COLLATE "pg_catalog"."default",
  "radio_frequency" varchar(50) COLLATE "pg_catalog"."default",
  "properties" jsonb DEFAULT '{}'::jsonb,
  "created_by" varchar(100) COLLATE "pg_catalog"."default" DEFAULT 'system'::character varying,
  "updated_by" varchar(100) COLLATE "pg_catalog"."default" DEFAULT 'system'::character varying,
  "created_at" timestamptz(6) DEFAULT CURRENT_TIMESTAMP,
  "updated_at" timestamptz(6) DEFAULT CURRENT_TIMESTAMP,
  "deleted_at" timestamptz(6)
)
;
COMMENT ON COLUMN "operational"."rescuers"."rescuer_id" IS '救援资源主键，UUID。';
COMMENT ON COLUMN "operational"."rescuers"."name" IS '资源名称或呼号。';
COMMENT ON COLUMN "operational"."rescuers"."rescuer_type" IS '资源类型，如 firefighter、medical、engineer、drone_operator。';
COMMENT ON COLUMN "operational"."rescuers"."team_id" IS '所属团队ID，可与其他系统的团队表对接。';
COMMENT ON COLUMN "operational"."rescuers"."team_name" IS '所属团队名称。';
COMMENT ON COLUMN "operational"."rescuers"."current_location" IS '当前地理位置（GEOGRAPHY Point）。';
COMMENT ON COLUMN "operational"."rescuers"."status" IS '资源状态，例如 available、on_mission、resting、unavailable。';
COMMENT ON COLUMN "operational"."rescuers"."availability" IS '是否可立即调度，true 表示可用。';
COMMENT ON COLUMN "operational"."rescuers"."skills" IS '能力标签数组，例如 {\"medical\",\"climbing\"}。';
COMMENT ON COLUMN "operational"."rescuers"."equipment" IS '携行装备或车辆配置的JSON描述。';
COMMENT ON COLUMN "operational"."rescuers"."phone" IS '联系电话。';
COMMENT ON COLUMN "operational"."rescuers"."radio_frequency" IS '无线电频率或呼号。';
COMMENT ON COLUMN "operational"."rescuers"."properties" IS '扩展属性JSON，记录自定义元数据。';
COMMENT ON COLUMN "operational"."rescuers"."created_by" IS '记录创建者，默认system表示系统预置。';
COMMENT ON COLUMN "operational"."rescuers"."updated_by" IS '记录最近更新者。';
COMMENT ON COLUMN "operational"."rescuers"."created_at" IS '记录创建时间。';
COMMENT ON COLUMN "operational"."rescuers"."updated_at" IS '记录最近更新时间。';
COMMENT ON COLUMN "operational"."rescuers"."deleted_at" IS '软删除时间。';
COMMENT ON TABLE "operational"."rescuers" IS '救援力量表，汇总可调派的人员与装备资源。';

