-- Table structure for role_layers
-- ----------------------------
DROP TABLE IF EXISTS "operational"."role_layers";
CREATE TABLE "operational"."role_layers" (
  "id" uuid NOT NULL DEFAULT uuid_generate_v4(),
  "role_id" int4 NOT NULL,
  "layer_id" uuid NOT NULL,
  "access_scope" "operational"."layer_access_scope_enum" NOT NULL DEFAULT 'view'::operational.layer_access_scope_enum,
  "visible_by_default" bool NOT NULL DEFAULT true,
  "sort_order" int4 NOT NULL DEFAULT 0,
  "created_at" timestamptz(6) NOT NULL DEFAULT now(),
  "updated_at" timestamptz(6) NOT NULL DEFAULT now()
)
;
COMMENT ON COLUMN "operational"."role_layers"."role_id" IS '引用 operational.roles.id。';
COMMENT ON COLUMN "operational"."role_layers"."layer_id" IS '引用 operational.layers.id。';
COMMENT ON COLUMN "operational"."role_layers"."access_scope" IS '访问范围：view=只读、manage=可编辑。';
COMMENT ON COLUMN "operational"."role_layers"."visible_by_default" IS '该角色是否默认显示图层。';
COMMENT ON TABLE "operational"."role_layers" IS '角色与图层的访问绑定表，控制不同角色默认显示哪些图层。';

-- ----------------------------
-- Records of role_layers
-- ----------------------------

-- ----------------------------
-- Table structure for roles
-- ----------------------------
DROP TABLE IF EXISTS "operational"."roles";
CREATE TABLE "operational"."roles" (
  "id" int4 NOT NULL DEFAULT nextval('"operational".roles_id_seq'::regclass),
  "name" varchar(100) COLLATE "pg_catalog"."default" NOT NULL,
  "description" text COLLATE "pg_catalog"."default"
)
;
COMMENT ON COLUMN "operational"."roles"."id" IS '角色主键，自增ID。';
COMMENT ON COLUMN "operational"."roles"."name" IS '角色名称，例如 INCIDENT_COMMANDER。';
COMMENT ON COLUMN "operational"."roles"."description" IS '角色职责或说明。';
COMMENT ON TABLE "operational"."roles" IS '业务角色表，定义平台中的职能角色。';

