-- ----------------------------
-- Table structure for routes
-- ----------------------------
DROP TABLE IF EXISTS "operational"."routes";
CREATE TABLE "operational"."routes" (
  "id" int4 NOT NULL DEFAULT nextval('"operational".routes_id_seq'::regclass),
  "path" varchar(255) COLLATE "pg_catalog"."default" NOT NULL,
  "name" varchar(100) COLLATE "pg_catalog"."default" NOT NULL,
  "description" text COLLATE "pg_catalog"."default",
  "role_id" int4,
  "created_time" timestamptz(6) DEFAULT now(),
  "key" varchar(100) COLLATE "pg_catalog"."default",
  "icon" varchar(255) COLLATE "pg_catalog"."default",
  "isFold" bool DEFAULT false,
  "partent_id" int4
)
;
